const App = () => (
  <div>
    <Switch>
      <Route path="/explorer" component={LandingPageContainer} />
      <Route path="/block/:block_hash" component={BlockContainer} />
      <Route path="/address/:address" component={AddressContainer} />
    </Switch>
  </div>
)

export default App;
